import React from "react";


function AddButton({onClick, children}) {
  return (
    <button className="add-button" onClick={onClick}>
      {children}
    </button>
  )
};

AddButton.propTypes = {
  onClick: propTypes.func,
  children: propTypes.node,
  

}

export default AddButton;
